import React, { Component } from 'react';

import axios from 'axios';

var url=`https://fakestoreapi.com/users/1`
class userdata extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
  
    

    componentDidMount() {axios.get(url)
    .then((apiresult)=>this.setState(apiresult.data))

    }

    
    render() {
        console.log(this.props)
        var{id, name, username, phone} =this.state
        return (
            <div>
              <h2>Selected Id Parameter For users only</h2>
              {this.state((res,index) =>{

              <table className="w-40 mx-auto table  table-bordered table-bark">
                  <tbody>
                      <tr key={index}>
                          <th>EMPID</th>
                          <td>{res.id}</td>
                      </tr>
                 
                      <tr>
                          <th>USERNAME</th>
                          <td>{res.username}</td>
                      </tr>


                      <tr>
                          <th>EMAIL</th>
                          <td>{res.email}</td>
                      </tr>

                      <tr>
                          <th>PHONE</th>
                          <td>{res.phone}</td>
                      </tr>
                  </tbody>
              </table>
               })}
            </div>
        );
    }
}



export default userdata;
